import React from 'react';
import './Preprocess.css';

const Preprocess = () => {
    return (
        <div className="preprocess-container">
            <h2 className="preprocess-title">Preprocessing Techniques</h2>
            <p>Select preprocessing techniques to apply to your dataset.</p>
        </div>
    );
};

export default Preprocess;
